// Photography.jsx
import React, { useEffect } from 'react';
import './Photography.css';

const Photography = () => {
  useEffect(() => {
    // Load the external portfolio script
    const script = document.createElement('script');
    script.src = 'https://www.redbubble.com/assets/external_portfolio.js';
    script.async = true;
    document.body.appendChild(script);

    // Add the script to render the Redbubble iframe
    script.onload = () => {
      const portfolioScript = document.createElement('script');
      portfolioScript.id = 'rb-xzfcxvzx';
      portfolioScript.type = 'text/javascript';
      portfolioScript.innerHTML = `new RBExternalPortfolio('www.redbubble.com', 'krood16', 2, 2).renderIframe();`;
      document.body.appendChild(portfolioScript);
    };
  }, []);

  return (
    <div className="photography">
      <h1>Photography</h1>
      
      {/* Embed Redbubble Portfolio */}
      <div id="rb-xzfcxvzx-container" className="embed-container"></div>
      
      <div className="gallery">
        <img src="photo1.jpg" alt="Photo 1" />
        <img src="photo2.jpg" alt="Photo 2" />
        <img src="photo3.jpg" alt="Photo 3" />
      </div>
    </div>
  );
};

export default Photography;
